<div class=" highlight hl-ipython3"><pre><span></span><span class="o">%%</span><span class="n">R</span>
<span class="nf">require</span><span class="p">(</span><span class="n">pracma</span><span class="p">)</span>
<span class="nf">require</span><span class="p">(</span><span class="n">Metrics</span><span class="p">)</span>
<span class="nf">require</span><span class="p">(</span><span class="n">readr</span><span class="p">)</span>
<span class="nf">library</span><span class="p">(</span><span class="n">reshape</span><span class="p">)</span>
<span class="n">all</span><span class="o">&lt;-</span> <span class="nf">read_csv</span><span class="p">(</span><span class="s">&quot;/content/drive/My Drive/Colab Notebooks/Optimization Course/ts_r.csv&quot;</span><span class="p">)</span>
<span class="n">all</span><span class="o">$</span><span class="n">X1</span><span class="o">&lt;-</span><span class="kc">NULL</span>
<span class="nf">for </span><span class="p">(</span><span class="n">i</span> <span class="n">in</span> <span class="m">1</span><span class="o">:</span><span class="m">30</span><span class="p">)</span> <span class="p">{</span> <span class="c1"># Set i days prediction</span>
  <span class="nf">if</span><span class="p">(</span> <span class="n">i</span><span class="o">&gt;</span><span class="m">1</span><span class="p">)</span> <span class="p">{</span><span class="n">all</span><span class="o">&lt;-</span><span class="n">all_new</span><span class="p">}</span>
  <span class="n">date</span><span class="o">&lt;-</span><span class="n">all[</span><span class="p">,</span><span class="m">1</span><span class="n">]</span>
  <span class="n">date</span><span class="nf">[nrow</span><span class="p">(</span><span class="n">date</span><span class="p">)</span> <span class="o">+</span> <span class="m">1</span><span class="p">,</span><span class="m">1</span><span class="n">]</span> <span class="o">&lt;-</span><span class="n">all</span><span class="nf">[nrow</span><span class="p">(</span><span class="n">all</span><span class="p">),</span><span class="m">1</span><span class="n">]</span><span class="m">+1</span>
  <span class="n">pred_all</span><span class="o">&lt;-</span><span class="kc">NULL</span>
  <span class="nf">for </span><span class="p">(</span><span class="n">n</span> <span class="n">in</span> <span class="m">2</span><span class="o">:</span><span class="nf">ncol</span><span class="p">(</span><span class="n">all</span><span class="p">)</span><span class="m">-1</span><span class="p">)</span> <span class="p">{</span>
    <span class="n">Y</span><span class="o">&lt;-</span><span class="nf">ts</span><span class="p">(</span><span class="n">data</span> <span class="o">=</span> <span class="n">all[n</span><span class="m">+1</span><span class="n">]</span><span class="p">,</span> <span class="n">start</span> <span class="o">=</span> <span class="m">1</span><span class="p">,</span> <span class="n">end</span> <span class="o">=</span><span class="nf">nrow</span><span class="p">(</span><span class="n">all</span><span class="p">)</span><span class="m">+1</span><span class="p">)</span>  
    <span class="n">sig_w</span><span class="o">&lt;-</span><span class="m">0.01</span>
    <span class="n">w</span><span class="o">&lt;-</span><span class="n">sig_w</span><span class="o">*</span><span class="nf">randn</span><span class="p">(</span><span class="m">1</span><span class="p">,</span><span class="m">100</span><span class="p">)</span> <span class="c1"># acceleration which denotes the fluctuation (Q/R) rnorm(100, mean = 0, sd = 1)</span>
    <span class="n">sig_v</span><span class="o">&lt;-</span><span class="m">0.01</span>
    <span class="n">v</span><span class="o">&lt;-</span><span class="n">sig_v</span><span class="o">*</span><span class="nf">randn</span><span class="p">(</span><span class="m">1</span><span class="p">,</span><span class="m">100</span><span class="p">)</span>  
    <span class="n">t</span><span class="o">&lt;-</span><span class="m">0.45</span>
    <span class="n">phi</span><span class="o">&lt;-</span><span class="nf">matrix</span><span class="p">(</span><span class="nf">c</span><span class="p">(</span><span class="m">1</span><span class="p">,</span><span class="m">0</span><span class="p">,</span><span class="n">t</span><span class="p">,</span><span class="m">1</span><span class="p">),</span><span class="m">2</span><span class="p">,</span><span class="m">2</span><span class="p">)</span>
    <span class="n">gama</span><span class="o">&lt;-</span><span class="nf">matrix</span><span class="p">(</span><span class="nf">c</span><span class="p">(</span><span class="m">0.5</span><span class="o">*</span><span class="n">t^2</span><span class="p">,</span><span class="n">t</span><span class="p">),</span><span class="m">2</span><span class="p">,</span><span class="m">1</span><span class="p">)</span>
    <span class="n">H</span><span class="o">&lt;-</span><span class="nf">matrix</span><span class="p">(</span><span class="nf">c</span><span class="p">(</span><span class="m">1</span><span class="p">,</span><span class="m">0</span><span class="p">),</span><span class="m">1</span><span class="p">,</span><span class="m">2</span><span class="p">)</span>
    <span class="c1">#Kalman</span>
    <span class="n">x0_0</span><span class="o">&lt;-</span><span class="n">p0_0</span><span class="o">&lt;-</span><span class="nf">matrix</span><span class="p">(</span><span class="nf">c</span><span class="p">(</span><span class="m">0</span><span class="p">,</span><span class="m">0</span><span class="p">),</span><span class="m">2</span><span class="p">,</span><span class="m">1</span><span class="p">)</span>
    <span class="n">p0_0</span><span class="o">&lt;-</span><span class="nf">matrix</span><span class="p">(</span><span class="nf">c</span><span class="p">(</span><span class="m">1</span><span class="p">,</span><span class="m">0</span><span class="p">,</span><span class="m">0</span><span class="p">,</span><span class="m">1</span><span class="p">),</span><span class="m">2</span><span class="p">,</span><span class="m">2</span><span class="p">)</span>
    <span class="n">Q</span><span class="o">&lt;-</span><span class="m">0.01</span>
    <span class="n">R</span><span class="o">&lt;-</span><span class="m">0.01</span>
    <span class="n">X</span><span class="o">&lt;-</span><span class="kc">NULL</span>
    <span class="n">X2</span><span class="o">&lt;-</span><span class="kc">NULL</span>
    <span class="n">pred</span><span class="o">&lt;-</span><span class="kc">NULL</span>
    <span class="nf">for </span><span class="p">(</span><span class="n">i</span> <span class="n">in</span> <span class="m">0</span><span class="o">:</span><span class="nf">nrow</span><span class="p">(</span><span class="n">all</span><span class="p">))</span> <span class="p">{</span>
      <span class="n">namp</span> <span class="o">&lt;-</span><span class="nf">paste</span><span class="p">(</span><span class="s">&quot;p&quot;</span><span class="p">,</span> <span class="n">i</span><span class="m">+1</span><span class="p">,</span><span class="s">&quot;_&quot;</span><span class="p">,</span><span class="n">i</span><span class="p">,</span> <span class="n">sep</span> <span class="o">=</span> <span class="s">&quot;&quot;</span><span class="p">)</span>
      <span class="nf">assign</span><span class="p">(</span><span class="n">namp</span><span class="p">,</span> <span class="n">phi</span><span class="o">%*%</span><span class="p">(</span><span class="nf">get</span><span class="p">(</span><span class="nf">paste</span><span class="p">(</span><span class="s">&quot;p&quot;</span><span class="p">,</span> <span class="n">i</span><span class="p">,</span><span class="s">&quot;_&quot;</span><span class="p">,</span><span class="n">i</span><span class="p">,</span> <span class="n">sep</span> <span class="o">=</span> <span class="s">&quot;&quot;</span><span class="p">)))</span><span class="o">%*%</span><span class="nf">t</span><span class="p">(</span><span class="n">phi</span><span class="p">)</span><span class="o">+</span><span class="n">gama</span><span class="o">%*%</span><span class="n">Q</span><span class="o">%*%</span><span class="nf">t</span><span class="p">(</span><span class="n">gama</span><span class="p">))</span>
      <span class="n">namk</span> <span class="o">&lt;-</span> <span class="nf">paste</span><span class="p">(</span><span class="s">&quot;k&quot;</span><span class="p">,</span> <span class="n">i</span><span class="m">+1</span><span class="p">,</span> <span class="n">sep</span> <span class="o">=</span> <span class="s">&quot;&quot;</span><span class="p">)</span>
      <span class="nf">assign</span><span class="p">(</span><span class="n">namk</span><span class="p">,</span><span class="nf">get</span><span class="p">(</span><span class="nf">paste</span><span class="p">(</span><span class="s">&quot;p&quot;</span><span class="p">,</span> <span class="n">i</span><span class="m">+1</span><span class="p">,</span><span class="s">&quot;_&quot;</span><span class="p">,</span><span class="n">i</span><span class="p">,</span> <span class="n">sep</span> <span class="o">=</span> <span class="s">&quot;&quot;</span><span class="p">))</span><span class="o">%*%</span><span class="nf">t</span><span class="p">(</span><span class="n">H</span><span class="p">)</span><span class="o">%*%</span><span class="p">(</span><span class="m">1</span><span class="o">/</span><span class="p">(</span><span class="n">H</span><span class="o">%*%</span><span class="nf">get</span><span class="p">(</span><span class="nf">paste</span><span class="p">(</span><span class="s">&quot;p&quot;</span><span class="p">,</span> <span class="n">i</span><span class="m">+1</span><span class="p">,</span><span class="s">&quot;_&quot;</span><span class="p">,</span><span class="n">i</span><span class="p">,</span> <span class="n">sep</span> <span class="o">=</span> <span class="s">&quot;&quot;</span><span class="p">))</span><span class="o">%*%</span><span class="nf">t</span><span class="p">(</span><span class="n">H</span><span class="p">)</span><span class="o">+</span><span class="n">R</span><span class="p">)))</span>
      <span class="n">namx</span> <span class="o">&lt;-</span> <span class="nf">paste</span><span class="p">(</span><span class="s">&quot;x&quot;</span><span class="p">,</span> <span class="n">i</span><span class="m">+1</span><span class="p">,</span><span class="s">&quot;_&quot;</span><span class="p">,</span><span class="n">i</span><span class="p">,</span> <span class="n">sep</span> <span class="o">=</span> <span class="s">&quot;&quot;</span><span class="p">)</span>
      <span class="nf">assign</span><span class="p">(</span><span class="n">namx</span><span class="p">,</span><span class="n">phi</span><span class="o">%*%</span><span class="nf">get</span><span class="p">(</span><span class="nf">paste</span><span class="p">(</span><span class="s">&quot;x&quot;</span><span class="p">,</span> <span class="n">i</span><span class="p">,</span><span class="s">&quot;_&quot;</span><span class="p">,</span><span class="n">i</span><span class="p">,</span> <span class="n">sep</span> <span class="o">=</span> <span class="s">&quot;&quot;</span><span class="p">)))</span>
      <span class="n">namE</span> <span class="o">&lt;-</span> <span class="nf">paste</span><span class="p">(</span><span class="s">&quot;E&quot;</span><span class="p">,</span> <span class="n">i</span><span class="m">+1</span><span class="p">,</span> <span class="n">sep</span> <span class="o">=</span> <span class="s">&quot;&quot;</span><span class="p">)</span>
      <span class="nf">assign</span><span class="p">(</span><span class="n">namE</span><span class="p">,</span><span class="n">Y[i</span><span class="m">+1</span><span class="n">]</span><span class="o">-</span><span class="n">H</span><span class="o">%*%</span><span class="nf">get</span><span class="p">(</span><span class="nf">paste</span><span class="p">(</span><span class="s">&quot;x&quot;</span><span class="p">,</span> <span class="n">i</span><span class="m">+1</span><span class="p">,</span><span class="s">&quot;_&quot;</span><span class="p">,</span><span class="n">i</span><span class="p">,</span> <span class="n">sep</span> <span class="o">=</span> <span class="s">&quot;&quot;</span><span class="p">)))</span>
      <span class="n">namx2</span> <span class="o">&lt;-</span> <span class="nf">paste</span><span class="p">(</span><span class="s">&quot;x&quot;</span><span class="p">,</span> <span class="n">i</span><span class="m">+1</span><span class="p">,</span><span class="s">&quot;_&quot;</span><span class="p">,</span><span class="n">i</span><span class="m">+1</span><span class="p">,</span> <span class="n">sep</span> <span class="o">=</span> <span class="s">&quot;&quot;</span><span class="p">)</span>
